public void close()
{
    whsWaveTableCreateForm.deleteWaveTable(whsWaveTable);

    if (formHasMethod(element.args().caller(), identifierStr(doRefresh)))
    {
        element.args().caller().doRefresh();
    }

    super();
}

public void init()
{
    if (!element.args().record() || element.args().dataset() != tableNum(WHSWaveTable))
    {
        throw error(error::missingFormActiveBuffer(element.name(), tableStr(WHSWaveTable)));
    }

    callerWaveTable = element.args().record();

    super();

    whsWaveTableCreateForm = WHSWaveTableCreateForm::newStandard(whsWaveTable_ds, whsWaveLine_ds, whsShipmentTable_ds);
}

public void run()
{
    super();

    origQueryShipments = whsShipmentTable_ds.query();
}

/// <summary>
///     Controls activation of 'Add' and 'Remove' buttons based on wave and wave pool.
/// </summary>
public void enableAddRemoveButtons()
{
    boolean canAddLineToWave        = whsWaveTableCreateForm.canAddLineToWave(whsWaveTable, whsShipmentTable);
    boolean canRemoveLineFromWave   = whsWaveTableCreateForm.canRemoveLineFromWave(whsWaveTable, whsWaveLine);

    addShipment.enabled(canAddLineToWave);
    addAllShipment.enabled(canAddLineToWave);
    remove.enabled(canRemoveLineFromWave);
    removeAll.enabled(canRemoveLineFromWave);
}

private void updateTotalShipment()
{
    [totalWeightShipments, totalVolumeShipments, totalQtyShipments, numLinesShipments] = whsWaveTableCreateForm.calcTotalsShipment();
}

public int active()
{
    int ret;

    ret = super();

    element.enableAddRemoveButtons();

    return ret;
}

