    curWaveRange.value(callerWaveTable.WaveId);
    curWaveRange.status(RangeStatus::Hidden);
}

public void init()
{
    super();

    var qbds = this.queryBuildDataSource();
    qbds.clearDynalinks();
    qbds.addRange(fieldNum(WHSShipmentTable, WorkTransType)).value(WHSWaveTemplateTable::applicableShippingWorkTransTypesRangeStr());
    qbds.addRange(fieldNum(WHSShipmentTable, InventLocationId)).value(queryValue(callerWaveTable.InventLocationId));
    qbds.addRange(fieldNum(WHSShipmentTable, ShipmentStatus)).value(SysQuery::valueNot(WHSWaveStatus::Shipped));
}

