public void filterLoadLines()
{
    var qbrQty = this.queryBuildDataSource().addRange(fieldNum(WHSLoadLine, InventQty));
    qbrQty.value(strFmt('(%1 != %2)', fieldStr(WHSLoadLine, InventQty), fieldStr(WHSLoadLine, WorkCreatedQty)));
}

public void init()
{
    super();

    var qbds = this.queryBuildDataSource();
    qbds.clearRanges();
    qbds.clearDynalinks();

    qbds.addRange(fieldNum(WHSWaveTable, WaveStatus)).value(
        strFmt('(%1.%2 < %3)', qbds.name(), fieldStr(WHSWaveTable, WaveStatus), any2Int(WHSWaveStatus::Held)));
}

