public boolean modified()
{
    WHSWaveFilterTable  waveFilterTable;
    boolean             ret;

    waveFilterTable = WHSWaveFilterTable::find(this.valueStr());

    whsShipmentTable_ds.queryBuildDataSource().clearDynalinks();

    if (waveFilterTable)
    {
        whsShipmentTable_ds.query(new QueryRun(waveFilterTable.WaveFilterQuery).query());
    }
    else
    {
        whsShipmentTable_ds.query(new QueryRun(origQueryShipments).query());
        if (this.valueStr())
        {
            throw warning("@WAX4870");
        }
    }

    ret = super();

    // Read ranged
    whsLoadLineFilter_ds.filterLoadLines();
    whsShipmentTable_ds.executeQuery();

    return ret;
}

